import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Layout from './components/Layout'
import NavigationBar from './components/NavigationBar'
import Jumbotron from './components/Jumbotron'
import HomePage from './components/pages/HomePage'
import ProjectsPage from './components/pages/ProjectsPage'
import NoMatchPage from './components/pages/NoMatchPage'
import ExperiencesPage from './components/pages/ExperiencesPage'

import Header from './components/Header'
import About from './components/About'
import Resume from './components/Resume'
import Projects from './components/Projects'
import Footer from './components/Footer'

/*
// We use React.Fragment to have multiple page components side by side (NavigationBar, Jumbotron, Router Layout)
function App() {

  return (
    <React.Fragment>
      <Jumbotron title={"ALLISON WU"} />
      <NavigationBar />
      <Layout>
        <Router>
          <Switch>
            <Route exact path="/" component={HomePage} />
            <Route exact path="/projects" component={ProjectsPage} />
            <Route exact path="/experiences" component={ExperiencesPage} />
            <Route component={NoMatchPage} />
          </Switch>
        </Router>
      </Layout>
    </React.Fragment>
  );
}

export default App;
*/

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      resumeData: {
        main: { name: "Allison Wu", namecapped: "ALLISON WU", bio: "I'm a sophomore Computer Science major at the University of Florida", phone: "(916) 952-3707", email: "allisonwu2000@gmail.com", resume: "https://drive.google.com/file/d/18D5CBLWpP9oDDFJ8k5-bPiPvS6HbVLSZ/view?usp=sharing" },
        resume: {
          skillmessage: "Proficient Technical Skills. I am currently seeking to learn more about User Experience, Reinforced Machine Learning.",
          education: [{ imgname: "uflogo", school: "The University of Florida, College of Engineering", degree: "Bachelor of Computer Science", graduated: "Expected Graduation: May 2022", description: "Minor in Statistics" }],
          work: [{ imgname: "intel-logo", company: "Intel", title: "Software Developer Intern", years: "May 2019 - Present", description: "Machine Learning, Web Development" },
          { imgname: "vector-logo", company: "Vector Solutions", title: "Data Management Intern", years: "April 2018 - May 2018", description: "Data wrangling and merging" }],
          involvement: [{ name: "SwampHacks", title: "Logistics Coordinator - Events", years: "September 2019 - Present", description: "Events activities responsibilities" },
          { name: "Magician", title: "Project Lead, Recruiter, UI programmer", years: "August 2018 - Present", description: "Unity (C#) game development" },
          {name: "Kickboxing", title: "Member", years: "September 2018 - Present", description: "Proud member of UFKB!" }
        ],
          skills: [
            { name: "Python", level: 600 },
            { name: "Java", level: 500 },
            { name: "C#", level: 500 },
            { name: "C++", level: 450 },
            { name: "HTML/CSS", level: 400 },
            { name: "JS", level: 400 },
            { name: "SQL", level: 350 },
            { name: "Git", level: 200 }
          ]
        },
        projects: [{ image: "image", title: "title", url: "url", category: "" }],
        social: [{ name: "linkedin", url: "https://linkedin.com/in/allisonwu2000/", className: "social-links" }, { name: "email", url: "mailto:allisonwu2000@gmail.com", className: "social-links" }]
      }
    };
  }

  render() {
    const { resumeData } = this.state

    return (
      <div className="App">
        <Header data={resumeData.main} />
        <About data={resumeData.main} />
        <Resume data={resumeData.resume} />
        <Projects data={resumeData.projects} />
        <Footer data={resumeData.social} />
      </div>
    );
  }
}

export default App;
